import React from 'react';

const App = () => {
  function handleText(ev) {
    ev.preventDefault();
    let text = ev.target.value;
  }
  return (
    <div>
      <input type='text' onKeyUp={handleText}></input>
      <p>{text}</p>
    </div>
  );
};

export default App;
